def palindrome_of_length_n(string):
    string = string.lower()
    palindromes_set = set()
    for i in range(len(string) - 12):
        substring = string[i:i+13]
        if substring == substring[::-1] and substring.isalpha():
            palindromes_set.add(substring)
    return palindromes_set
